{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 Phase Adjusting Router\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Send input channels to output channels with optional polarity adjustments. Output can either replace or merge with existing audio on the output channels.\par}
{\pard \ql \f0 \sa180 \li0 \fi0 http://wiki.cockos.com/wiki/index.php/Jesusonic_Effects_Documentation#PhaseAdjustingRouter\par}
}

