{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 MIDI Duplicate Filter\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Counts incoming on/off message for each note and filters out all except the first on and last off, so overlapping short notes become one long note.\par}
{\pard \ql \f0 \sa180 \li0 \fi0 http://wiki.cockos.com/wiki/index.php/Jesusonic_Effects_Documentation#DuplicateFilter\par}
}

